import React from 'react';
import { Icon } from 'semantic-ui-react'
class Assets extends React.Component{
	constructor(props){
		super(props)

    }
render(){
    return(
    <div>
        <div className="assetbar">
            <a>  Discovery    </a>
            <a>  List  </a>
            <a>  Map  </a>
        </div>
    
    <style jsx>{`
    .assetbar {
        display: flex;
        flex-direction: row;
        justify-content: flex-start;
      align-items: center;
        background: white;
        min-width: 160px;
        box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
        z-index: 1;
        position:absolute;
        width:108%;
      }
      .assetbar >a {
        color: gray;
        text-decoration: none;
          display:flex;
        flex-direction: row;
        align-items: center;
        justify-content: center;
            font-family: 'Gilroy', sans-serif;
        font-size: 14px;
        text-transform:uppercase;
        font-weight:400;
        width: 180px;
        height:70px;
        opacity: 0.8;
      }
    
    `}</style>
    
    
    </div>
    );

}
}
export default Assets;
